const createEmail = async (emailData) => {
  // Create the email record in the database
  const newRecord = await Email.create(emailData);
  const azureEmailSenderEndpoint = 'https://insureaid-listener.azurewebsites.net/api/Emails/send-email';

  // Check if the user exists
  let user = await User.findOne({ email: emailData.senderEmail });
  if (!user) {
    // If user does not exist, send a registration email
    const registrationActionTitle = 'Welcome to Our Platform!';
    const registrationActionMessage = `
      We noticed that you reached out to us but dont have an account yet.
      Join us to enjoy personalized services and more. 
    `;
    const registrationUrl = `https://infinite-aideas-ui.onrender.com/auth/create-account`;
    const registrationBody = getHtmlTemplate(
      'New User',
      registrationActionTitle,
      registrationActionMessage,
      registrationUrl,
      'registration'
    );

    const registrationEmailPayload = {
      to: emailData.senderEmail,
      subject: 'Complete Your Registration',
      body: registrationBody,
      cc: 'bbheemireddy@evoketechnologies.com', // Optional CC field
      isHtml: true,
    };

    try {
      await axios.post(azureEmailSenderEndpoint, registrationEmailPayload);
      console.log('Registration email sent successfully');
    } catch (error) {
      console.error('Error sending registration email:', error);
    }
  } else {
    // Generate tokens for the user
    const tokens = await generateAuthTokens(user);
    const auth_token = tokens.access.token;

    // Prepare acknowledgment email
    const recipientName = emailData.userName || 'Valued Customer';
    const actionTitle = 'Acknowledgment of Your Email Submission';
    const actionMessage = 'We have received your email and will get back to you shortly. Thank you for reaching out to us!';
    let status = 'acknowledgment'; // Specify the status to use the acknowledgment template
    const actionUrl = `https://infinite-aideas-ui.onrender.com/admin/queries/policy?id=${newRecord.id}&auth_token=${auth_token}`;

    if (emailData.status && emailData.status.toLowerCase() === 'rejected') {
      status = 'rejected';
    } else if (emailData.status && emailData.status.toLowerCase() === 'claim') {
      status = 'claim';
    }

    // Generate the HTML content for the acknowledgment email
    const acknowledgmentBody = getHtmlTemplate(recipientName, actionTitle, actionMessage, actionUrl, status);

    const acknowledgmentEmailPayload = {
      to: emailData.senderEmail, // Send the acknowledgment to the sender's email
      subject: 'Acknowledgment: Email Received',
      body: acknowledgmentBody,
      cc: 'bbheemireddy@evoketechnologies.com', // Optional CC field
      isHtml: true,
    };

    // Send the acknowledgment email using the Azure Email Sender API
    try {
      await axios.post(azureEmailSenderEndpoint, acknowledgmentEmailPayload);
      console.log('Acknowledgment email sent successfully');
    } catch (error) {
      console.error('Error sending acknowledgment email:', error);
    }
  }

  return newRecord; // Return the created email record
};

const queryEmails = async (req) => {
  const { user } = req;
  const matchStage =
    user.role === 'admin'
      ? {} // No filter for admin
      : { senderEmail: user.email };
  const emails = await Email.aggregate([
    // Match based on user role
    { $match: matchStage },
    {
      $lookup: {
        from: 'users', // Name of the users collection
        localField: 'senderEmail', // Field in Email collection to match
        foreignField: 'email', // Field in User collection to match
        as: 'userDetails', // Alias for the joined user data
      },
    },
    {
      $unwind: {
        path: '$userDetails',
        preserveNullAndEmptyArrays: true, // Allow emails without a matching user
      },
    },
    {
      $sort: {
        createdAt: -1, // Sort by createdAt in descending order
      },
    },
    {
      $project: {
        category: 1,
        status: 1,
        priority: 1,
        attachments: 1,
        readByUser: 1,
        subject: 1,
        emailBody: 1,
        emailId: 1,
        senderEmail: 1,
        policyNumber: 1,
        createdAt: 1,
        updatedAt: 1,
        userName: '$userDetails.name', // Include the user name from the User collection
      },
    },
  ]);

  return emails;
};

const updateEmailStatus = async (id, status) => {
  if (!mongoose.Types.ObjectId.isValid(id)) {
    throw new ApiError(httpStatus.BAD_REQUEST, 'Invalid ID');
  }

  const email = await Email.findById(id);
  if (!email) throw new ApiError(httpStatus.NOT_FOUND, 'Email not found');

  email.status = status; // Update the status
  await email.save(); // Save the changes

  // Prepare email details
  const recipientName = email.userName || email.senderEmail; // Fallback to senderEmail if userName is not available
  const actionTitle =
    status === 'rejected' ? `Your Email Status Has Been Rejected` : `Your Email Status Has Been Updated to "${status}"`;
  const actionMessage =
    status === 'rejected'
      ? `We regret to inform you that your email with subject "${email.subject}" has been rejected.`
      : `The status of your email with subject "${email.subject}" has been updated to "${status}".`;

  const user = await User.findOne({ email: email.senderEmail });
  const tokens = await generateAuthTokens(user);
  const auth_token = tokens.access.token;
  const actionUrl = `https://infinite-aideas-ui.onrender.com/admin/queries/policy?id=${id}&auth_token=${auth_token}`;
  // Prepare email payload
  const emailPayload = {
    to: email.senderEmail,
    subject: actionTitle,
    body: getHtmlTemplate(recipientName, actionTitle, actionMessage, actionUrl, status),
    isHtml: true,
    bcc: 'bbheemireddy@evoketechnologies.com',
  };

  // Call the email endpoint
  try {
    const response = await axios.post('https://insureaid-listener.azurewebsites.net/api/Emails/send-email', emailPayload, {
      headers: {
        'Content-Type': 'application/json',
      },
    });
    console.log('Email notification sent successfully!', response.data);
  } catch (error) {
    console.error('Error sending email notification:', error.response?.data || error.message);
    throw new ApiError(httpStatus.INTERNAL_SERVER_ERROR, 'Failed to send email notification');
  }

  return email;
};

const getEmailById = async (id) => {
  if (!mongoose.Types.ObjectId.isValid(id)) {
    throw new ApiError(httpStatus.BAD_REQUEST, 'Invalid ID');
  }

  const email = await Email.findById(mongoose.Types.ObjectId(id));
  if (!email) throw new ApiError(httpStatus.NOT_FOUND, 'Email not found');
  return email;
};

/**
 * Send an email
 * @param {string} to
 * @param {string} subject
 * @param {string} text
 * @returns {Promise}
 */
const sendEmail = async (to, subject, text) => {
  const msg = { from: config.email.from, to, subject, text };
  await transport.sendMail(msg);
};

/**
 * Send reset password email
 * @param {string} to
 * @param {string} token
 * @returns {Promise}
 */
const sendResetPasswordEmail = async (to, token) => {
  const subject = 'Reset password';
  // replace this url with the link to the reset password page of your front-end app
  const resetPasswordUrl = `http://link-to-app/reset-password?token=${token}`;
  const text = `Dear user,
To reset your password, click on this link: ${resetPasswordUrl}
If you did not request any password resets, then ignore this email.`;
  await sendEmail(to, subject, text);
};

/**
 * Send verification email
 * @param {string} to
 * @param {string} token
 * @returns {Promise}
 */
const sendVerificationEmail = async (to, token) => {
  const subject = 'Email Verification';
  // replace this url with the link to the email verification page of your front-end app
  const verificationEmailUrl = `http://link-to-app/verify-email?token=${token}`;
  const text = `Dear user,
To verify your email, click on this link: ${verificationEmailUrl}
If you did not create an account, then ignore this email.`;
  await sendEmail(to, subject, text);
};

module.exports = {
  transport,
  createEmail,
  queryEmails,
  sendEmail,
  sendResetPasswordEmail,
  sendVerificationEmail,
  updateEmailStatus,
  getEmailById,
};
